// ==UserScript==
// @name       Steam Community+
// @namespace  http://jessecar96.net/
// @version    1.0
// @description  Adds some usefull things to the steam community.
// @match      http://*.steamcommunity.com/*
// @copyright  2012+, Jessecar96
// ==/UserScript==


//Images
var steamCommunityBG = "data:;base64,";
steamCommunityBG = "http://i.imgur.com/Faz2X.png";

//Variables
var SteamID64,PlusBar,SteamID32,TogglePlusElement;


(function(){
    
    /*--- Create a proper unsafeWindow object on browsers where it doesn't exist
    (Chrome, mainly).
    Chrome now defines unsafeWindow, but does not give it the same access to
    a page's javascript that a properly unsafe, unsafeWindow has.
    This code remedies that.
    */
    
    var bGreasemonkeyServiceDefined     = false;
    try {
        if (typeof Components.interfaces.gmIGreasemonkeyService === "object") {
            bGreasemonkeyServiceDefined = true;
        }
    }
    catch (err) {
        //Ignore.
    }
    
    if ( typeof unsafeWindow === "undefined"  ||  ! bGreasemonkeyServiceDefined) {
        unsafeWindow    = ( function () {
            var dummyElem   = document.createElement('p');
            dummyElem.setAttribute ('onclick', 'return window;');
            return dummyElem.onclick ();
        } ) ();
    }
    
    console.log("Steam Community+");
        
    
    
    
    if(document.getElementById("profileBlock")){
        //It's a profile
        
        SteamID64 = unsafeWindow.ajaxFriendUrl.split("/").slice(-1)[0];
        SteamID32 = profileToSteamID(SteamID64);
        
        //PlusBar
        PlusBar = document.createElement("div");
        PlusBar.style.lineHeight = "1.3em";
        PlusBar.style.background = "url("+steamCommunityBG+")";
        PlusBar.style.textAlign = "left";
        PlusBar.style.boxShadow = "inset 0px 0px 9px -2px black";
        PlusBar.style.width = "928px";
        PlusBar.style.borderRadius = "5px";
        PlusBar.style.marginTop = "6px";
        PlusBar.style.marginBottom = "6px";
        PlusBar.style.padding = "10px";
        //PlusBar.style. = "text-align:left;border-radius:5px;margin-top:6px;margin-bottom:6px;padding:10px;";
        PlusBar.innerHTML = "Loading...";
        PlusBar.id = "ST_PlusBar";
        
        document.getElementsByTagName("center")[0].insertBefore(PlusBar,document.getElementById("mainBody"));
        
        PopulatePlusBar();
        
        if(window.localStorage.PlusBarHidden=="true"){
            console.log("sadsad");
            HidePlusBar();
        }
        
        
        
    }
        
})();

function togglePlusBar(){
    
    if(document.getElementById("ST_TogglePlusBar").innerHTML=="Hide"){
        HidePlusBar();
    }else{
        //Show it
        document.getElementById("ST_TogglePlusBar").innerHTML="Hide";
        PopulatePlusBar();
        window.localStorage.PlusBarHidden = false;
    }
    
}

function PopulatePlusBar(){
    
    document.getElementById("ST_PlusBar").innerHTML = "";
    document.getElementById("ST_PlusBar").innerHTML += "<div id='ST_TogglePlusBarOutter' style='float: right;margin-right: 5px;'></div>";
    document.getElementById("ST_PlusBar").innerHTML += "SteamID64: "+SteamID64+"<br/>";
    document.getElementById("ST_PlusBar").innerHTML += "SteamID32: "+SteamID32+"<br/>";
    document.getElementById("ST_PlusBar").innerHTML += "Backpack: <a href='http://tf2b.com/tf2/"+SteamID64+"'>TF2B</a>&nbsp;&nbsp;<a href='http://tf2items.com/profiles/"+SteamID64+"/'>TF2Items</a>&nbsp;&nbsp;<a href='http://backpack.tf/id/"+SteamID64+"/'>backpack.tf</a>&nbsp;&nbsp;<a href='http://optf2.com/tf2/"+SteamID64+"/'>OPTF2</a><br/>";
    document.getElementById("ST_PlusBar").innerHTML += "Other Links: <a href='http://tf2ls.com/id/"+SteamID64+"/'>TF2LS</a>&nbsp;&nbsp;<a href='http://tf2r.com/user/"+SteamID64+".html'>TF2R</a>&nbsp;&nbsp;<a href='http://steamrep.com/profiles/"+SteamID64+"'>SteamRep</a>&nbsp;&nbsp;<a href='http://tf2stats.net/player/"+SteamID64+"'>TF2 Stats</a>";
    
    TogglePlusElement =  document.createElement("a");
    TogglePlusElement.id = "ST_TogglePlusBar";
    TogglePlusElement.innerHTML = "Hide";
    TogglePlusElement.href = "javascript:void(0);";
    TogglePlusElement.onclick = togglePlusBar;
    
    document.getElementById("ST_TogglePlusBarOutter").appendChild(TogglePlusElement);
    
}


function HidePlusBar(){
 
    //Hide it
        
    document.getElementById("ST_PlusBar").innerHTML = "Steam Community+";
    document.getElementById("ST_PlusBar").innerHTML += "<div id='ST_TogglePlusBarOutter' style='float: right;margin-right: 5px;'></div>";
    TogglePlusElement =  document.createElement("a");
    TogglePlusElement.id = "ST_TogglePlusBar";
    TogglePlusElement.innerHTML = "Hide";
    TogglePlusElement.href = "javascript:void(0);";
    TogglePlusElement.onclick = togglePlusBar;
    
    document.getElementById("ST_TogglePlusBarOutter").appendChild(TogglePlusElement);
    document.getElementById("ST_TogglePlusBar").innerHTML="Show";
    window.localStorage.PlusBarHidden = true;
    
    
}

function profileToSteamID(profile)
{
    var base = "7960265728"
    var profile = profile.substr(7)
    
    var subtract = 0
    var lastIndex = base.length - 1
    
    for(var i=0;i<base.length;i++)
    {
        var value = profile.charAt(lastIndex - i) - base.charAt(lastIndex - i)
        
        if(value < 0)
        {
            var index = lastIndex - i - 1
            
            base = base.substr(0,index) + (Number(base.charAt(index)) + 1) + base.substr(index+1)
            
            if(index)
            {
                value += 10
            }
            else
            {
                break
            }
        }
        
        subtract +=  value * Math.pow(10,i)
    }
    
    return "STEAM_0:" + (subtract%2) + ":" + Math.floor(subtract/2)
}
